import React, {useEffect, useState} from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import { Link } from 'react-router-dom';

export default function EmployeeList() {
  const navigate = useNavigate();
  const [employees, setEmployees] = useState([]);

  const handleSubmit = (e) => {
    e.preventDefault();
    navigate('/createEmployee');
  };

  // useEffect(() => {
  //   axios.get('http://localhost:8000/employees')
  //     .then(response => {
  //       setEmployees(response.data);
  //     })
  //     .catch(error => {
  //       console.error('There was an error fetching the data!', error);
  //     });
  // }, []);

  useEffect(() => {
    axios.get('http://localhost:8000/employees')
      .then(response => {
        if (Array.isArray(response.data)) {
          setEmployees(response.data);
        } else {
          console.error('Expected an array but received:', response.data);
        }
      })
      .catch(error => {
        console.error('There was an error fetching the data!', error);
      });
  }, []);

  return (
    <div>
        <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.3/dist/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-QWTKZyjpPEjISv5WaRU9OFeRpok6YctnYmDr5pNlyT2bRjXh0JMhjY6hW+ALEwIH" crossorigin="anonymous"/>
        <nav class="navbar navbar-expand-lg bg-body-tertiary">
            <div class="container-fluid">
                <a class="navbar-brand" href="/dashboard">HOME</a>

                <div class="collapse navbar-collapse" id="navbarText">
                </div>
                <div class="container-fluid">
                    <a class="navbar-brand" href="/dashboard">Employee Count:</a>
                </div>
                <div class="container-fluid">
                    <button    
                      type="submit"
                      value="Submit"
                      onClick={(e) => handleSubmit(e)}
                      class="navbar-brand"
                    >
                      Create Employee
                    </button> 
                </div>
            </div>
        </nav>
        <div>
          <h2>Employee Table</h2>
          <table border="1">
            <thead>
              <tr>
                <th scope="col">Unique ID</th>
                <th scope="col">Image</th>
                <th scope="col">Name</th>
                <th scope="col">Email</th>
                <th scope="col">Mob.No.</th>
                <th scope="col">Designation</th>
                <th scope="col">Gender</th>
                <th scope="col">Course</th>
                <th scope="col">Create Date</th>
                <th scope="col">Action</th>
              </tr>
            </thead>
            <tbody>
            <tr>
            <td>{employees.f_Id}</td>
            <td>{employees.f_Image}</td>
            <td>{employees.f_Name}</td>
            <td>{employees.f_Email}</td>
            <td>{employees.f_Mobile}</td>
            <td>{employees.f_Designation}</td>
            <td>{employees.f_gender}</td>
            <td>{employees.f_Course}</td>
            <td>{employees.f_Createdate}</td>
            <td>
              <Link to="" className="btn btn-success mx-1">Edit</Link>
              <Link to="" className="btn btn-success mx-1">Delete</Link>
            </td>
          </tr>
            </tbody>
          </table>
        </div>
    </div>
  )
}
